import { Container } from "react-bootstrap";
import AdminNav from '../nav/admin_nav';
import Departments from '../admin/departments';

class DepartmentsPage extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <>
                <AdminNav />
                <br />
                <Container>
                    <Departments />
                </Container>
                <br />
            </>
        );
    }
}

export default DepartmentsPage;
